import React from 'react';
import QuestionCard from './QuestionCard';

// You would replace these with real data
const questions = [
  {
    id: 1,
    image: '/path-to-your-image.png', // This should be the path to the image
    question: '이런 모임 어때요?',
  },
  // ... more questions
];

const Content = () => {
  return (
    <div style={{ padding: '20px' }}>
      {questions.map((q) => (
        <QuestionCard key={q.id} image={q.image} question={q.question} onAnswer={() => {}} />
      ))}
    </div>
  );
};

export default Content;
